// convert ingredients to a dictionary
var ingredients_dict = {};
for (var i = 0; i < ingredients.length; i++) {
    ingredients_dict[ingredients[i].id_mc] = ingredients[i];
}

// // convert primitives to a dictionary
// var primitives_dict = {};
// for (var i = 0; i < primitives.length; i++) {
//     primitives_dict[primitives[i].name] = primitives[i];
// }

// all items are keys of the ingredients
let all_items = Object.keys(ingredients_dict);

function get_full_construction(item_id) {
    var full_construction = [];
    var fringe = [item_id];
    while (fringe.length > 0) {
        var item_id = fringe.pop();
        var item_obj = ingredients_dict[item_id];
        // if it does not have a recipe, just push it into construction
        full_construction.push(item_id);
        if (item_obj["recipe"] != null) {
            let recipe = item_obj["recipe"];
            full_construction.push(recipe);
            var unique_ingredients = new Set(recipe);
            // for each item in the set, add it to the fringe
            unique_ingredients.forEach(function(item) {
                if (item != 0) {
                    fringe.push(item);
                }
            });
        }
    }
    return full_construction;
}

function recipe_loc_to_place_cmd(recipe_loc) {
    let first_coord = Math.floor(recipe_loc / 3);
    let second_coord = recipe_loc % 3;
    let cmd_name = "place_" + first_coord + "_" + second_coord;
    return cmd_name;
    // return primitives_dict[cmd_name];
}

function sample_makeable_item() {
    let random_item = all_items[Math.floor(Math.random() * all_items.length)];
    // check it has a recipe
    if (ingredients_dict[random_item]["recipe"] != null) {
        return random_item;
    } else {
        return sample_makeable_item();
    }
}

function count_makeable_item() {
    let count = 0;
    for (let i = 0; i < all_items.length; i++) {
        let item = all_items[i];
        if (ingredients_dict[item]["recipe"] != null) {
            count += 1;
        }
    }
    return count;
}

// fuzz the name with a similar name
function fuzz_name(name) {
    // get the words in name
    let words = name.split(" ");
    var new_name = "";
    for (let i = 0; i < words.length; i++) {
        var cur_word = words[i];
        // convert to lower case
        cur_word = cur_word.toLowerCase();
        // if cur_word is in the sim_words, replace it with a similar word
      if (sim_words.hasOwnProperty(cur_word)) {
        let sim_word_candidates = sim_words[cur_word];
        // randomly pick one of the similar words from candidates
        let random_amount = 5;
        let random_index = Math.floor(Math.random() * random_amount);
        let sim_word = sim_word_candidates[random_index];
        new_name += sim_word + " ";
      } else {
        // just use the word as is
        new_name += cur_word + " ";
      }
    }
    return new_name;
}

